function Form({handleFirst, handleSecond, handleSubmit,firstInput, secondInput, display}){



return(
    <form onSubmit={handleSubmit}>
        <input type = "text" value = {firstInput}
        onChange={handleFirst}
        ></input>
        <input type = "text" value = {secondInput}
        onChange={handleSecond}
        ></input>
        <button type = "submit">Click</button>
        <ul>
        {
        display.map((names, index) => {
        return <li key={index}>{names}</li>
        })}
        </ul>
    </form>
)
}
export default Form
